import Card from "../card/Card";
import CardBody from "../card/CardBody";
import './ratings.css';
import { useEffect } from "react";
import StarIcon from "./StarIcon";

export default function Ratings({p}) {
    useEffect(() => {
        console.log(p.ratings
            )
    }, [p])

    const {endurance, mobility, offense, scoring, support} = p.ratings;

    const ratings = [
        { "Endurance": endurance }, 
        { "Mobility" : mobility },
        { "Offense": offense },
        { "Scoring": scoring },
        { "support": support } 
    ];

    function Stars({score, name}) {
        return (
            <div className="star-row">
                <span>{name}</span>
                <div>
                    <div class="star-ratings-css" title={score}></div>
                </div>
            </div>
        )
    }

    return (
        <div>
            <Card
                p={p}
                title="Ratings">
                <CardBody>
                    { ratings.map( r => (
                        <Stars name={Object.keys(r)} score={r[Object.keys(r)]}></Stars>
                    ))}
                </CardBody>
            </Card>
        </div>
    )
}
